INSERT INTO `announcements` (`id`, `title`, `details`, `created_at`, `updated_at`) VALUES
(1, 'মুকুলকে পাবলিক অ্যাকাউন্টস কমিটি(পিএসি)-র', '<p>বিধানসভার অন্য যে আট কমিটির মাথায় বিজেপি বিধায়করা বসেছেন তাঁরা ইস্তফা দিয়েছেন। মুকুলের বিরুদ্ধে দলত্যাগ বিরোধী আইন কার্যকরের দাবিতে পশ্চিমবঙ্গেরস্পিকার বিমান বন্দ্যোপাধ্যায়ের কাছে আর্জি জানানোর পাশাপাশি আদালতে যাওয়ার প্রস্তুতিও নিচ্ছে বিজেপি। সেই সঙ্গে বিধানসভায় রীতি ভাঙা হয়েছে বলেও রাষ্ট্রপতির কাছে অভিযোগ জানাতে চান শুভেন্দুরা। এটাও বিজেপি বিধায়কদের দিল্লি সফরের অন্যতম লক্ষ্য।</p>', '2021-07-19 21:38:52', '2021-07-19 21:38:52'),
(2, 'Registration for Maharashtra FYJC CET to open on', '<p>Dinkar Patil, chairman of the Maharashtra State Board of Secondary and Higher Secondary Education (MSBSHSE) confirmed that the CET will take place by August 21. While the CET itself is not mandatory for any student and all students who have passed Class 10 have been assured of a FYJC seat by the Maharashtra education board, first priority in admissions would be given to candidates who have appeared for the CET.</p>', '2021-07-19 21:40:07', '2021-07-19 21:40:07'),
(3, 'Lorem Ipsum is simply dummy text of the printing', '<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', '2021-07-19 22:55:50', '2021-07-19 22:55:50'),
(5, 'Why do we use it?', '<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>', '2021-07-19 22:56:35', '2021-07-19 22:56:35'),
(6, 'Where can I get some?', '<p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don&#39;t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn&#39;t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.</p>', '2021-07-19 22:58:49', '2021-07-19 22:58:49');
